title: Mutual recursion in a chain of inheritance
description: >
  The defect manifests in the form of call chain cycles.
  The following cycles are present here:
  o20759.m27 -> o20789.m36 -> o20759.m6 -> o20759.m27
  o20759.m6 -> o20759.m27 -> o20789.m36 -> o20759.m6
  o20789.m36 -> o20759.m6 -> o20759.m27 -> o20789.m36

features:
  - inheritance
  - overriding
  - method
  - polymorphism

